import "./HomeDisigin.css";
import Back from '../../../src/Components/assets/agriculture.jpg'
import Button from '../../../src/Components/Button/Button'

export default function HomePage() {
  return (
    <div className="container">
      <div className="grid">
        <div className="para">
          <h1 className="thish1">Agriculture<br></br><span>System</span></h1>
          <p>This webpage serves as a comprehensive platform bridging the gap between machinery and field workers. It offers a virtual space where an array of agricultural machinery is showcased alongside the skilled labor force. With a user-friendly interface, visitors can explore a diverse range of machinery tailored to various agricultural needs, from tractors and harvesters to irrigation systems and beyond. </p>
          <Button buttonclass='signup' name='Signup'/>
        </div>
        <div className="photo">
          <img src={Back}/>

        </div>
      </div>
    </div>
  );
}
